import React from "react";
import { Link } from "react-router-dom";
import Typewrier from "typewriter-effect";

function Home() {
  return (
    <>
      <div className="fullPage ">
        <div className="thoborBackground">
          <div className="banner">
            <h1>
              <Typewrier
                onInit={(type) => {
                  type
                    .typeString(
                      "Bine ai venit la tresure hunt-ul organizat de Thobor"
                    )
                    .start();
                }}
              />
            </h1>
          </div>
        </div>

        <div className="optiuni">
          <div className="start">
            <h2>
              <Link to>Start</Link>
            </h2>
          </div>
          <div className="instructiuni">
            <h2>instructiuni</h2>
          </div>
        </div>
      </div>
    </>
  );
}

export default Home;
